import React from 'react';
import './App.css';
import Main from './components/Pages/Main';
import Navbar from './components/Navbar/Navbar';
import Particles from 'react-particles-js';

const particalOpt = {
  particles: {
    number: {
      value: 130,
      density: {
        enable: true,
        value_area: 800

      },

    }
  }
}


const App = () => (
  <div>

    <Navbar />

    <div className="container">
      <Main />
    </div>
    <Particles
      canvasClassName="example"
      height="120px"
      width="300px"
      params={{
        polygon: {
          enable: true,
          type: 'inside',
          move: {
            radius: 10
          },
          url: 'path/to/svg.svg'
        }
      }} />
  </div>
)

export default App;
